import { EthProvider } from "./contexts/EthContext";
import { Outlet, Link } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <EthProvider>
      <div id="App" >
        <div className="container">
          <Link to="/RequestDelivery">Request Delivery</Link>
          <Link to="/AcceptDelivery">Accept Delivery</Link>
        </div>
      </div>
    </EthProvider>
  );
}



export default App;
